import React from 'react';
import { carData } from '../carData';

export const CarList = () => {
    const styles = {
        ul:{

            textAlign:'left'
        },
        div:{
            width:'25%'
        }
    }
  return (
    <div style={styles.div}>
            {carData.map(car=> (
                <button>{car.Name}</button>
            ))}
    </div>
  )
}
